import React from "react";
import { Link } from "react-router-dom"
const Nav = () => {
    return (
        <div>
            <ul className="nav">
                <li><Link to="/">Home</Link></li>
                {/* <li><Link to="/empolyee">Empolyees</Link></li> */}
                <li><Link to="/">Login</Link></li>
                <li><Link to="/">Signup</Link></li>
            </ul>
        </div>
    );
}

export default Nav;
